import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import NavBar from './pages/NavBar';

const index = ReactDOM.createRoot(document.getElementById('index'));
index.render(
  <React.StrictMode>
    <NavBar />
    <App />
  </React.StrictMode>
);
